// SPDX-License-Identifier: MIT
pragma solidity ^0.8.25;

import "./SSTORE2.sol";

interface IStorage {
    function getPointer() external view returns (address);
}

contract HashJingViewer {
    address public immutable chunk1;

    constructor(address _chunk1) {
        chunk1 = _chunk1;
    }

    function getSVG() external view returns (string memory) {
        bytes memory svg;

        svg = bytes.concat(svg, tryRead(chunk1, 1));

        return string(svg);
    }

    function tryRead(address chunk, uint8 index) internal view returns (bytes memory) {
        try IStorage(chunk).getPointer() returns (address ptr) {
            return SSTORE2.read(ptr);
        } catch {
            revert(string(abi.encodePacked("Failed on chunk #", toString(index))));
        }
    }

    function toString(uint256 value) internal pure returns (string memory) {
        // From OpenZeppelin Strings.toString()
        if (value == 0) {
            return "0";
        }
        uint256 temp = value;
        uint256 digits;
        while (temp != 0) {
            digits++;
            temp /= 10;
        }
        bytes memory buffer = new bytes(digits);
        while (value != 0) {
            digits -= 1;
            buffer[digits] = bytes1(uint8(48 + uint256(value % 10)));
            value /= 10;
        }
        return string(buffer);
    }
}

